import {FETCH, DELETE,CREATE,SEARCH,SAVE} from '../ActionTypes/tablelist'


const initialState = {
    data : '',
};



export const  tablelistReducer = (state = initialState, action ) => {
    switch (action.type) {
        case FETCH:
            return {
                ...state,
                data : action.payload,
            }

        default:
            return state;
    }
}
